import React from "react"
import { useFormikContext } from "formik"
import { CardContent, Typography, Box } from "@material-ui/core"
import { Divider } from "@mui/material"

export default function FormReview() {
	const { values } = useFormikContext()
	const array = Object.entries(values)

	return (
		<CardContent>
			<Box sx={{ display: "flex" }}>
				<Typography variant='h2' style={{ fontSize: "30px" }}>
					Review Details
				</Typography>
			</Box>
			<Box sx={{ margin: "20px" }}>
				{array.map((item, index) => {
					let title = ""
					const keyNameCorrector = (value) => {
						if (value) {
							if (value === "firstName") {
								value = "First Name"
							}
							if (value === "lastName") {
								value = "Last Name"
							}
							if (value === "email") {
								value = "Email"
							}
							if (value === "age") {
								value = "Age"
							}
							if (value === "compay") {
								value = "Company"
							}
							if (value === "address1") {
								value = "Address 1"
							}
							if (value === "address2") {
								value = "Address 2"
							}
							if (value === "city") {
								value = "City"
							}
							if (value === "province") {
								value = "Province"
							}
							if (value === "postalcode") {
								value = "Postal Code"
							}
						}
						title = value
						return title
					}

					return (
						<div key={index}>
							<Typography
								variant='body1'
								style={{ fontSize: "15px", margin: "10px" }}>
								{item[0]}: {item[1]}
							</Typography>
							<Divider />
						</div>
					)
				})}
			</Box>
		</CardContent>
	)
}
